import React from 'react'
import Card from '../Card/Card'

const FoodListMain = () => {
    const foodsArray = [
        { id: 1, name: 'kebab', price: '10$', rate: 5, img: '../img/foods/kebab.jpg'}
    ]
    return (
        <>
            <Card>
                <div className='food flex flex-wrap'>
                    
                        <div className="bg-[url('./img/foods/kebab.jpg')] w-full"></div>
                    
                </div>
            </Card>
        </>
    )
}

export default FoodListMain
